type DitherFunc func(int, int, RGB565) RGB565

func None(x, y int, c RGB565) RGB565 {
	return c
}

func Bayer2(x, y int, c RGB565) RGB565 {
	if c == White || c == Black {
		return c
	}
	return Quantize2(ToFloat(c) + BayerMatrix2[x%32][y%32])
}

func Bayer16(x, y int, c RGB565) RGB565 {
	if c == White || c == Black {
		return c
	}
	return Quantize16(ToFloat(c) + BayerMatrix16[x%32][y%32])
}

func BlueNoise2(x, y int, c RGB565) RGB565 {
	if c == White || c == Black {
		return c
	}
	return Quantize2(ToFloat(c) + BlueNoiseMatrix2[x%32][y%32])
}

func BlueNoise16(x, y int, c RGB565) RGB565 {
	if c == White || c == Black {
		return c
	}
	return Quantize16(ToFloat(c) + BlueNoiseMatrix16[x%32][y%32])
}
